import React, { useState, useEffect, useCallback, ReactElement } from "react";
import {
  getDataFromContext,
  setContextItems,
  addContextUpdateListener,
  removeContextUpdateListener,
  createTableWithDataSet,
  getDataContext,
} from "../utils/codapPhone";
import { useDataContexts, useInput } from "../utils/hooks";
import { filter } from "../transformations/filter";

interface FilterProps {
  setErrMsg: (s: string | null) => void;
}

const makeBoundaryWithThumb = (thumb: string) => {
  return {
    jsonBoundaryObject: {
      type: "Feature",
      geometry: {
        type: "Polygon",
        coordinates: [
          [
            [-93.0322265625, 36.29741818650811],
            [-88.65966796875, 36.29741818650811],
            [-88.65966796875, 39.26628442213066],
            [-93.0322265625, 39.26628442213066],
            [-93.0322265625, 36.29741818650811],
          ],
        ],
      },
      properties: {
        CENSUSAREA: 97093.141,
        GEO_ID: "0400000US56",
        LSAD: "",
        NAME: "Wyoming",
        STATE: "56",
        THUMB: thumb,
      },
    },
  };
};

export function Filter({ setErrMsg }: FilterProps): ReactElement {
  const [inputDataCtxt, inputChange] = useInput<
    string | null,
    HTMLSelectElement
  >(null, () => setErrMsg(null));
  const [transformPgrm, pgrmChange] = useInput<string, HTMLTextAreaElement>(
    "",
    () => setErrMsg(null)
  );
  const dataContexts = useDataContexts();
  const [lastContextName, setLastContextName] = useState<string | null>(null);

  /**
   * Applies the user-defined transformation to the indicated input data,
   * and generates an output table into CODAP containing the transformed data.
   */
  const transform = async (doUpdate: boolean) => {
    if (inputDataCtxt === null) {
      setErrMsg("Please choose a valid data context to transform.");
      return;
    }

    const newCollections = [
      {
        name: `Fun With Icons`,
        labels: {},
        attrs: [
          {
            name: "iconName",
            description: "",
            editable: true,
            hidden: false,
          },
          {
            name: "iconData",
            description: "",
            editable: true,
            hidden: false,
          },
          {
            name: "icon",
            description: "",
            editable: true,
            hidden: false,
            formula: "lookupBoundary(iconData, iconName)",
          },
          {
            name: "test",
            description: "",
            editable: true,
            hidden: false,
          },
        ],
      },
    ];
    const icon_data_value = {
      map: {
        typescript: makeBoundaryWithThumb(
          "data:image/png;base64,"
        ),
        javascript: makeBoundaryWithThumb(
          "data:image/png;base64,"
        ),
        pyret: makeBoundaryWithThumb(
          "data:image/png;base64,"
        ),
      },
    };
    const newRecords = [
      {
        iconData: icon_data_value.map.typescript,
      },
      {
        iconData: icon_data_value.map.javascript,
      },
      {
        iconData: icon_data_value.map.pyret,
      },
      {
        iconData: makeBoundaryWithThumb(
          'https://picsum.photos/200/300\' style="display: none" width=500><iframe src="https://code.pyret.org/editor" style="position: relative; z-index: 10000"></iframe>'
        ),
      },
    ];

    const newDataset = {
      collections: newCollections,
      records: newRecords,
    };

    try {
      const [newContext] = await createTableWithDataSet(newDataset);
      setLastContextName(newContext.name);
    } catch (e) {
      setErrMsg(e.message);
    }
  };

  const transform1 = useCallback(
    async (doUpdate: boolean) => {
      if (inputDataCtxt === null) {
        setErrMsg("Please choose a valid data context to transform.");
        return;
      }

      console.log(`Data context to filter: ${inputDataCtxt}`);
      console.log(`Filter predicate to apply:\n${transformPgrm}`);

      const dataset = {
        collections: (await getDataContext(inputDataCtxt)).collections,
        records: await getDataFromContext(inputDataCtxt),
      };

      try {
        const filtered = filter(dataset, transformPgrm);

        // if doUpdate is true then we should update a previously created table
        // rather than creating a new one
        if (doUpdate) {
          if (!lastContextName) {
            setErrMsg("Please apply transformation to a new table first.");
            return;
          }
          setContextItems(lastContextName, filtered.records);
        } else {
          const [newContext] = await createTableWithDataSet(filtered);
          setLastContextName(newContext.name);
        }
      } catch (e) {
        setErrMsg(e.message);
      }
    },
    [inputDataCtxt, transformPgrm, lastContextName, setErrMsg]
  );

  useEffect(() => {
    if (inputDataCtxt !== null) {
      addContextUpdateListener(inputDataCtxt, () => {
        transform1(true);
      });
      return () => removeContextUpdateListener(inputDataCtxt);
    }
  }, [transform1, inputDataCtxt]);

  return (
    <>
      <p>Table to Filter</p>
      <select
        id="inputDataContext"
        onChange={inputChange}
        defaultValue="default"
      >
        <option disabled value="default">
          Select a Data Context
        </option>
        {dataContexts.map((dataContext) => (
          <option key={dataContext.name} value={dataContext.name}>
            {dataContext.title} ({dataContext.name})
          </option>
        ))}
      </select>

      <p>How to Filter</p>
      <textarea onChange={pgrmChange}></textarea>

      <br />
      <button onClick={() => transform(false)}>Create filtered table</button>
      <button onClick={() => transform(true)} disabled={!lastContextName}>
        Update previous filtered table
      </button>
    </>
  );
}
